import re


def re_shop_data():
    new_shop_data = open(r'X:\数据库\欧洲亚马逊\amazon_uk_shopinfo.txt', 'w', encoding='utf-8')
    with open(r'X:\数据库\欧洲亚马逊\amazon_uk_shopinfo-data_合并.txt', 'r', encoding='utf-8') as old_shop_data:
        for shop_data in old_shop_data:
            shop_data_list = shop_data.strip().split(',')
